import React, { useEffect, useState } from 'react';
import '../index.css';

const ChatPage = () => {
  const [showIntro, setShowIntro] = useState(true);
  const [chats, setChats] = useState(["Chat 1", "Chat 2"]);
  const [selectedChat, setSelectedChat] = useState("Chat 1");
  const [messages, setMessages] = useState([]);
  const [input, setInput] = useState("");

  useEffect(() => {
    const timer = setTimeout(() => setShowIntro(false), 4000);
    return () => clearTimeout(timer);
  }, []);

  const handleSend = () => {
    if (!input.trim()) return;
    setMessages(prev => [...prev, { type: "user", text: input }]);
    setInput("");
  };

  const handleNewChat = () => {
    const newChat = `Chat ${chats.length + 1}`;
    setChats(prev => [...prev, newChat]);
    setSelectedChat(newChat);
    setMessages([]); // Reset messages for new chat
  };

  return (
    <div className="relative min-h-screen bg-black text-white overflow-hidden">
      <div className="stars absolute top-0 left-0 w-full h-full z-0"></div>
      <div className="twinkling absolute top-0 left-0 w-full h-full z-0"></div>

      {showIntro && (
        <div className="absolute top-1/2 left-1/2 transform -translate-x-1/2 text-4xl md:text-6xl font-extrabold z-20 animate-welcome text-transparent bg-clip-text bg-gradient-to-r from-[#FFB200] via-[#EB5B00] to-[#E52020]">
          WELCOME TO COSMICO
        </div>
      )}

      {!showIntro && (
        <div className="relative z-10 flex items-center justify-center min-h-screen px-4 animate-fade-in">
          <div className="w-full max-w-6xl h-[90vh] rounded-3xl border border-white/10 bg-black/50 backdrop-blur-md shadow-xl flex overflow-hidden">

            {/* Sidebar */}
            <div className="w-[260px] bg-gradient-to-b from-[#1f1f1f]/80 to-[#2c2c2c]/60 border-r border-white/10 p-4 flex flex-col justify-between">
              <div>
                <h2 className="text-xl font-bold mb-4 text-[#FFB200]">CosmicoBot</h2>
                <div className="space-y-2 max-h-[60vh] overflow-y-auto pr-1">
                  {chats.map((chat, idx) => (
                    <div
                      key={idx}
                      onClick={() => setSelectedChat(chat)}
                      className={`cursor-pointer text-sm px-3 py-2 rounded-lg ${
                        chat === selectedChat
                          ? "bg-[#3a3a3a] text-white font-medium"
                          : "hover:bg-[#2a2a2a] text-white/70"
                      }`}
                    >
                      {chat}
                    </div>
                  ))}
                </div>
                <button
                  onClick={handleNewChat}
                  className="mt-4 w-full text-sm py-1 rounded-md bg-[#FFB200]/10 hover:bg-[#FFB200]/20 text-[#FFB200] border border-[#FFB200]/50"
                >
                  + New Chat
                </button>
              </div>
              <div className="text-xs text-white/60 text-center">Log In</div>
            </div>

            {/* Chat Area */}
            <div className="flex-1 flex flex-col justify-between">
              <div className="flex-1 overflow-y-auto p-8 space-y-6">
                {messages.map((msg, i) => (
                  <div key={i} className={`flex ${msg.type === "user" ? "justify-end" : "items-start space-x-2"}`}>
                    {msg.type !== "user" && <span className="text-[#FFB200]">✨</span>}
                    <div className={`${msg.type === "user" ? "bg-gradient-to-br from-[#FFFFFF] to-[#BBBBBB] text-black" : "bg-[#2a2a2a] text-white"} px-4 py-2 rounded-xl max-w-2xl text-sm shadow-sm`}>
                      {msg.text}
                    </div>
                  </div>
                ))}
              </div>

              {/* Input */}
              <div className="p-4 border-t border-white/10">
                <div className="relative max-w-3xl mx-auto">
                  <input
                    type="text"
                    value={input}
                    onChange={(e) => setInput(e.target.value)}
                    onKeyDown={(e) => e.key === "Enter" && handleSend()}
                    placeholder="Send a message..."
                    className="w-full bg-[#1f1f1f]/70 border border-white/20 rounded-full px-6 py-3 text-sm text-white placeholder-white/50 outline-none backdrop-blur-sm"
                  />
                  <button
                    onClick={handleSend}
                    className="absolute right-3 top-1/2 -translate-y-1/2 text-white/80 hover:text-white"
                  >
                    ↑
                  </button>
                </div>
              </div>
            </div>

          </div>
        </div>
      )}
    </div>
  );
};

export default ChatPage;
